import{_ as i,o as e,c as t,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 29.1-534 Right to fish in interjurisdictional inland waters.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-534.md","filePath":"vacode/29.1-534.md"}'),r={name:"vacode/29.1-534.md"},n=a('<h1 id="§-29-1-534-right-to-fish-in-interjurisdictional-inland-waters" tabindex="-1">§ 29.1-534 Right to fish in interjurisdictional inland waters. <a class="header-anchor" href="#§-29-1-534-right-to-fish-in-interjurisdictional-inland-waters" aria-label="Permalink to &quot;§ 29.1-534 Right to fish in interjurisdictional inland waters.&quot;">​</a></h1><p>A Virginia resident or a resident of an adjoining jurisdiction which has inland water lying adjacent to Virginia land or water may take fish with hook and line after complying with the requirements of the laws of the jurisdiction where the fishing occurs. For purposes of this section and § <a href="http://law.lis.virginia.gov/vacode/29.1-535/" target="_blank" rel="noreferrer">29.1-535</a>, the term &quot;jurisdiction&quot; shall include the District of Columbia.</p><p>1952, c. 484, § 29-153.1; 1964, c. 74; 1970, c. 194; 1987, c. 488; 1991, c. 200; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0093" target="_blank" rel="noreferrer">93</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0179" target="_blank" rel="noreferrer">179</a>.</p>',3),o=[n];function s(c,l,h,d,_,f){return e(),t("div",null,o)}const p=i(r,[["render",s]]);export{u as __pageData,p as default};
